import collections
from typing import List


class Solution:
    def maxSubarrayLength(self, nums: List[int], k: int) -> int:
        def judge(dic):
            for d in dic:
                if dic[d] > k:
                    return True
            return False
        _dic = collections.Counter(nums)
        if not judge(_dic):
            return len(nums)
        print(_dic)

        cur_len = 0
        dic = {i:0 for i in nums}
        max_len = 0
        n = len(nums)
        left = 0


        for right in range(n):
            cur_len += 1
            dic[nums[right]] += 1
            while dic[nums[right]] > k:
                cur_len -= 1
                dic[nums[left]] -= 1
                left += 1
            max_len = max(max_len,cur_len)
        return max_len
